    return (
        <>
            <Wrapper>
                <img src={ logo } alt="MemeMaker"/>

                <Card>
                    <h2>Selecione um template</h2>

                    <Templates>
                        <button>
                            <img src="" alt="Template"/>
                        </button>
                    </Templates>

                    <h2>Textos</h2>

                    <Form>
                        <input type="text"/>
                        <input type="text"/>
                        <input type="text"/>

                        <Button type="submit">MakeMyMeme</Button>
                    </Form>
                </Card>
            </Wrapper>
        </>
    );
};

export default Home;
